import react from 'react'
import Link from 'next/Link'

// import specific style here
import headerStyles from './styles/header.module.scss';

class Header extends react.Component {

    render() {
        // items in return block are JSX
        // React.Fragments can be used interchangeably with divs
        // divs are not always necessary
        return (
            <div className={headerStyles.navBar}>


                <Link href="/"><div className={headerStyles.Logo}></div></Link>

                <div className={headerStyles.navLinks}>
                    <Link href="/about"><a>About Page</a></Link>
                    <Link href="/projects"><a>Projects Page</a></Link>
                    <Link href="/fitness"><a>Fitness Page</a></Link>
                    <Link href="/blogs"><a>Blogs Page</a></Link>
                </div>

                <div className={headerStyles.login}>
                    <Link href="/"><a>Login</a></Link>
                </div>
            </div>
        )
    }
}

export default Header
